import React from 'react';
import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core';

import Posts from './components/Posts/Posts'
import Form from './components/Form/Form'
import aliRoosterQuote from './images/aliRoosterQuote.jpg';
import useStyles from './styles'

function App() {
  const classes = useStyles();

  return (
  <Container maxWidth="lg">
    <AppBar className={classes.appBar} position="static" color="inherit">
      <Typography className={classes.header} variant="h2" align="center" >Errol'</Typography>
      <img className={classes.image} src={aliRoosterQuote} alt="aliRoosterQuote" height='260'/>
    </AppBar>
    <Grow in>
      <Container>
        <Grid container justify="space-between" alignItems="stretch" spacing={3}>
        <Grid item xs={12} sm={7}>
            <Posts />
        </Grid>
        <Grid item xs={12} sm={4}>
            <Form />
        </Grid>
        </Grid>
      </Container>
    </Grow>
  </Container>
  );
}

export default App;
